import React from 'react';

import {StyleSheet, TextInput} from 'react-native';

const Input = props => { 

    return <TextInput {...props} style={{...styles.input, ...props.styles}} />;
};

const styles = StyleSheet.create({
    input:{
        height:30,
        borderBottomColor:'grey',
        borderBottomWidth:1,
        margin:10
    }
});


export default Input;
